    "nb": "InnholdEtter 1.1.2009:Kommersielle undersøkelser samt ODs undersøkelser som er meldt inn til ODs innrapporteringssystem for undersøkelser på norsk sokkel. De geografiske områdene som vises er planlagte områder, som ikke nødvendigvis tilsvarer de faktiske.Dette inkluderer følgende typer undersøkelser:Ordinær seismisk undersøkelseHavbunnseismisk undersøkelseElektromagnetisk undersøkelseBorestedsundersøkelse /site surveyGrunnundersøkelserFor en nærmere forklaring se innrapporteringssystemet under \"Klassifisering\". Undersøkelsene kan ha følgende status:Under behandling – innmeldt av ansvarlig selskap og oppdatert i ODs databaser. Avventer saksbehandling i OD, Fiskeridirektoratet, Forsvaret og Havforskningsinstituttet.Planlagt – saksbehandling ferdigstilt i OD, Fiskeridirektoratet, Forsvaret og Havforskningsinstituttet. Oppstart vil skje ihht planlagt start dato.Pågående – undersøkelsen er i gang.Pause – undersøkelsen har av diverse grunner tatt en pause, for eksempel grunnet vær, båt etc.Ferdig – undersøkelsen er ferdig, og sluttmelding sendt til OD.Avlyst – av diverse årsaker ble undersøkelsen aldri startet opp.Før 1.1.2009:Undersøkelser som er gjort før ODs innrapporteringssystem ble startet. Geografiske områder er ikke inkludert og derfor er lenke til kart ikke tilgjengelig. "
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eInnhold\u003c/p\u003e\u003cp\u003e\u003cbr\u003e\u003cstrong\u003eEtter 1.1.2009:\u003c/strong\u003e\u003cbr\u003eKommersielle undersøkelser samt ODs undersøkelser som er meldt inn til ODs innrapporteringssystem for undersøkelser på norsk sokkel. De geografiske områdene som vises er planlagte områder, som ikke nødvendigvis tilsvarer de faktiske.\u003cbr\u003e\u003cbr\u003eDette inkluderer følgende typer undersøkelser:\u003c/p\u003e\u003cul\u003e\u003cli\u003eOrdinær seismisk undersøkelse\u003c/li\u003e\u003cli\u003eHavbunnseismisk undersøkelse\u003c/li\u003e\u003cli\u003eElektromagnetisk undersøkelse\u003c/li\u003e\u003cli\u003eBorestedsundersøkelse /site survey\u003c/li\u003e\u003cli\u003eGrunnundersøkelser\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eFor en nærmere forklaring se innrapporteringssystemet under \"Klassifisering\". Undersøkelsene kan ha følgende status:\u003c/p\u003e\u003cul\u003e\u003cli\u003eUnder behandling – innmeldt av ansvarlig selskap og oppdatert i ODs databaser. Avventer saksbehandling i OD, Fiskeridirektoratet, Forsvaret og Havforskningsinstituttet.\u003c/li\u003e\u003cli\u003ePlanlagt – saksbehandling ferdigstilt i OD, Fiskeridirektoratet, Forsvaret og Havforskningsinstituttet. Oppstart vil skje ihht planlagt start dato.\u003c/li\u003e\u003cli\u003ePågående – undersøkelsen er i gang.\u003c/li\u003e\u003cli\u003ePause – undersøkelsen har av diverse grunner tatt en pause, for eksempel grunnet vær, båt etc.\u003c/li\u003e\u003cli\u003eFerdig – undersøkelsen er ferdig, og sluttmelding sendt til OD.\u003c/li\u003e\u003cli\u003eAvlyst – av diverse årsaker ble undersøkelsen aldri startet opp.\u003c/li\u003e\u003c/ul\u003e\u003cp\u003e\u003cbr\u003e\u003cstrong\u003eFør 1.1.2009:\u003c/strong\u003e\u003cbr\u003eUndersøkelser som er gjort før ODs innrapporteringssystem ble startet. Geografiske områder er ikke inkludert og derfor er lenke til kart ikke tilgjengelig.\u003cbr\u003e \u003c/p\u003e"
  },
