  "title": {
    "nb": "Innretning (Facility)"
  },
  "description": {
    "nb": "DefinisjonFast innretning: Innretning som er permanent plassert på feltet i feltets levetid. Produksjonsskip omfattes av denne definisjonen ettersom de er ment å være permanent plassert på feltet.Flyttbar innretning: Innretning som er registrert i et nasjonalt skipsregister (flagget innretning) og dermed må følge et maritimt driftskonsept inkl klassing, for eksempel boreinnretning og brønnintervensjonsinnretning."
