  "description": {
    "nb": "SynonymLisens er i denne sammenheng synonymt med \"Utvinningstillatelse\".InnholdUtvinningstillatelser på norsk kontinentalsokkel, med komplett historie for hver utvinningstillatelse.DefinisjonUtvinningstillatelser tildeles av Olje- og Energidepartementet. Overføring av en utvinningstillatelse eller andel av en utvinningstillatelse må godkjennes av departementet.MerknadPetoro AS har ansvar for å forvalte Statens deltakerandeler gjennom Statens direkte økonomiske engasjement (SDØE) i rettighetshavergrupper der slike andeler til enhver tid eksisterer."
  },
