    "nb": "InnholdLitostratigrafiske enheter (grupper, formasjoner og ledd) på norsk kontinentalsokkel. Inkluderer letebrønnbaner som penetrerer en bestemt enhet, og brønnbaner med kjerneprøver.MerknadIkke alle brønner som er boret på norsk sokkel er representert her. Så langt er 1100 frigitte brønner inkludert - først og fremst letebrønner - deriblant alle frigitte brønner i Barentshavet og Norskehavet. For noen intervaller i enkelte brønner er kun grupper tolket og ingen formasjonstopper er plassert. Ledd er bare tolket i brønner i typebrønn-området. For brønnbaner med kjerneprøver er ikke kjerne-logg dybdeskiftet blitt tatt hensyn til. Dette skiftet er vanligvis opp til noen få meter. Kjerneintervaller refererer til ”drillers depth”, mens litostratigrafiske topper refererer til ”loggers depth”. Litostratigrafi er alltid tolket i det siste brønnsporet. I noen få tilfeller er borekjerner blitt tatt i tekniske sidesteg som ikke er identisk med det siste brønnsporet."
  },
